import {Route, Link, Routes} from 'react-router-dom';
import Home from './Home';
import About from './About';
import Contact from './Contact';
import Error from './Error';
import NavBar from './NavBar';

const App = () => {
  return (
<>
<Routes>
<Route path="/" Component={Home}  />

</Routes>
</>  )
}

export default App
